import React from 'react';
import './card_display.css';

const CardDisplay = ({ cards }) => {
  return (
    <div className="card-display">
      <div className="card-number">{cards.cardNumber}</div>
      <div className="card-name">{cards.cardName}</div>
      <div className="expiry-date">{cards.expiryDate}</div>
      <div className="cvv1">{cards.cvv}</div>
    </div>
  );
};

export default CardDisplay;
